import React from "react";
import Link from 'next/link'

export default function about() {
  return (
      <div>
        <nav>
        <ul>
        <Link href="/about">
          <a>About Us</a>
        </Link>

          <Link href="/projects">
          <a>Projects</a>
        </Link>

          <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/contact">
          <a>About Us</a>
        </Link>
        </ul>
      </nav>
    <div className="flex-container">
      <div className="flex-item-left">
      <style jsx>
        {`
          ul {
            list-style-type: none;
            margin-right: 2rem;
          }

          li {
            float: right;
            color: white;
            text-align: center;
            padding: 10px;
            text-decoration: none;
            font-size: 20px;
            line-height: 35px;
            border-radius: 4px;
            display: block;
            font-family: "Roboto", sans-;
          }
          nav {
            overflow: hidden;
            background-color: red;
            position: fixed;
            top: 0;
            width: 100%;
            float: right;
            padding: 5px 5px;
          }


        `}
      </style>

        <style jsx global>{`
  body {
    background: lightblue};
    padding: 90%;

  }
  .flex-container {
    display: flex;
    flex-direction: row;
    font-size: 20px;
    text-align: center;
  }

  .flex-item-left {
    background-color: #f39b6d;
    flex: 50%;
    width: 300px;
    padding: 30px;
  }

  .flex-item-right {
    padding: 30px;
    flex: 50%;
    background-color: #41e2ba;
    width: 300px;
  }
`}</style>        
        <h1>Looking for a developer ?</h1>
        <p>
          Welcome to my Porfolio website. my name is OLALEKAN OGUNDELE I am a
          Small Business Owner,Photograher and aspiring Full Stack Web
          Developer. You can see some of the things i have worked on on my and
          also on my Github page
        </p>
      </div>
      <div class="flex-item-right">

        <h3>Skills and Tools</h3>

        <ul id="skilllist">
          <li>HTML</li>
          <li>CSS</li>
          <li>JAVASCRIPT</li>
          <li>Bootstrap</li>
          <li>Git</li>
          <li>Nodejs</li>
        </ul>

      </div>
    </div>
    </div>

  );
}
